import React from 'react'
import Toolbar from "@mui/material/Toolbar";
import AppBar from '@mui/material/AppBar';
const Header = () => {
    const appHeader = () => {
        return <Toolbar>Header goes here</Toolbar>;
    };
    return (
        <Header>
            <AppBar>{appHeader}</AppBar>
        </Header>

    );
}

export default Header
